import { Link } from "react-router-dom";

const Dropdown = props => (
  <ul className={props.hidden}>
    {/* {props.activeIndex != null && (
            )} */}
    {props.item1 != null && (
      <li>
        <Link className="rightmenu-link" to={props.url1}>
          {props.item1}
        </Link>
      </li>
    )}
    {props.item2 != null && (
      <li>
        <Link className="rightmenu-link" to={props.url2}>
          {props.item2}
        </Link>
      </li>
    )}
    {props.item3 != null && (
      <li>
