          {props.item3}
        </Link>
      </li>
    )}
    {props.item4 != null && (
      <li>
        <Link className="rightmenu-link" to={props.url4}>
          {props.item4}
        </Link>
      </li>
    )}
    {props.item5 != null && (
      <li>
        <Link className="rightmenu-link" to={props.url5}>
          {props.item5}
        </Link>
      </li>
    )}
    {props.item6 != null && (
      <li>
        <Link className="rightmenu-link" to={props.url6}>
          {props.item6}
        </Link>
      </li>
    )}
    {props.item7 != null && (
      <li>
        <Link className="rightmenu-link" to={props.url7}>
          {props.item7}
        </Link>
      </li>
    )}
  </ul>
);

export default Dropdown;
